import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
  Container,
  Typography,
  Grid,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
  IconButton,
} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';

const Assets = () => {
  const [assets, setAssets] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/assets')
      .then(response => {
        setAssets(response.data);
      })
      .catch(error => {
        console.error('Error fetching assets:', error);
      });
  }, []);

  const handleDelete = (id) => {
    axios.delete(`http://localhost:5000/assets/${id}`)
      .then(() => {
        setAssets(assets.filter(asset => asset._id !== id));
      })
      .catch(error => {
        console.error('Error deleting asset:', error);
      });
  };

  return (
    <Container>
      <Typography variant="h4" gutterBottom>
        Asset Management
      </Typography>
      <Grid container spacing={3}>
        <Grid item xs={12}>
          <Paper elevation={3} style={{ padding: '16px' }}>
            <Typography variant="h6" gutterBottom>
              Assets
            </Typography>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>Asset Name</TableCell>
                  <TableCell>Ticker</TableCell>
                  <TableCell>Actions</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {assets.map((asset) => (
                  <TableRow key={asset._id}>
                    <TableCell>{asset.name || 'Unknown Name'}</TableCell>
                    <TableCell>{asset.ticker || 'Unknown Ticker'}</TableCell>
                    <TableCell>
                      <IconButton onClick={() => handleDelete(asset._id)} color="error">
                        <DeleteIcon />
                      </IconButton>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </Paper>
        </Grid>
      </Grid>
    </Container>
  );
};

export default Assets;
